import { useEffect, useState } from "react";

export function City(data) {
    
    let city = "";

    window.setTimeout(()=> {
        useEffect(()=> {
            if(data.title != undefined) {
                city = data.title;
            } else {
                city = "Desconhecido!";
            }
        },[])
    }, 2000);

    
    console.log(data.title);
    

    return(
    <div>
        <p>{city}</p>
    </div>
    );
}
